import React, { useState } from "react";
import "./VolunteeringLogin.css";

const VolunteeringLogin = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Logowanie:", email);
  };

  return (
    <div className="auth-container">
      <h2>Logowanie wolontariusza</h2>

      <form onSubmit={handleSubmit} className="auth-form">
        <label>Email:</label>
        <input
          type="email"
          required
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        />

        <label>Hasło:</label>
        <input
          type="password"
          required
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />

        <button type="submit" className="auth-btn">
          Zaloguj się
        </button>
      </form>

      <p className="auth-switch">
        Nie masz konta? <a href="/volunteering-register">Zarejestruj się</a>
      </p>
    </div>
  );
};

export default VolunteeringLogin;
